import React from 'react';
import ReactDOM from 'react-dom';

const Hello: React.FC = props => {
  return (
    <div>
      <p>Hello world</p>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
